import React from "react";
import { Link } from "react-router-dom/cjs/react-router-dom.min";
import Input from "../components/Input";

function Signin() {
    return (
        <div className="form">
            <form >
                <h1>Transfy</h1>

                <div className="input">
                    <label>Nom</label>
                    <input type="text" placeholder="Entrer votre nom" />
                </div>

                <div className="input">
                    <label>Prénom</label>
                    <input type="text" placeholder="Entrer votre prénom" />
                </div>
                <Input label="E-mail" type="text" placeholder="Entrer votre e-mail" />

                <div className="input">
                    <label>E-mail</label>
                    <input type="text" placeholder="Entrer votre e-mail" />
                </div>

                <Input label="CIN" type="text" placeholder="Entrer votre numero CIN" />
                <Input label="Mot de passe" type="passowrd" placeholder="Entrer votre mot de passe" />
                <button type="submit">S'inscrire</button>
            </form>
            <p>Avez-vous dèja un compte? <Link to="/">Se connecter</Link> </p>
        </div>
    );
}

export default Signin;
